import React from 'react';
import {office} from '../data'


const About = () =>{

      return (
            <div id='about' className='about'>
                  <h2>Our story</h2>
                  <p>Discord is about giving people the power to create belonging in their lives. We want to make it easier for you to talk regularly with the people you care about. We want you to build genuine relationships with your friends and communities close to home or around the world. Original, reliable, playful, and relatable. These are the values that connect our users and our employees at Discord.</p>
                  <h2>Our office</h2>
                  <div className='about_images'>
                        
                                    {office.map((pic,index)=>{
                                          return(
                                          <div className='about_image_flex'>
                                                <div className='about_img'>
                                                      <div key={index} className='about_image'>
                                                            <img src={pic.url} alt={'image ' + (index+1)}/>
                                                      </div>
                                                </div>
                                          </div>
                                          )
                                    })}
                              
                  </div>
            </div>
      )
}

export default About;
